import { keepPreviousData, useQuery } from "@tanstack/react-query";
import axios from "axios";

interface UserList {
  id: number;
  name: string;
  username: string;
  email: string;
  address: {
    street: string;
    suite: string;
    city: string;
    zipcode: string;
    geo: {
      lat: string;
      lng: string;
    };
  };
  phone: string;
  website: string;
  company: {
    name: string;
    catchPhrase: string;
    bs: string;
  };
}
///"https://jsonplaceholder.typicode.com/users"

const fetchUsers = async (): Promise<UserList[]> => {
  const { data } = await axios.get<UserList[]>(
    "https://jsonplaceholder.typicode.com/users"
  );
  return data;
};

const Map: React.FC = () => {
  return (
    <div className="p-8 bg-gray-200 flex flex-col md:flex-row shadow-xl rounded-lg space-x-4"></div>
  );
};

export default Map;
